import React, {useState , useEffect} from "react";
//components
import Map from '../Map/index'

//Styles
import {Wrapper, Content, Nav, MapContainer, styledBtn} from './Form.styles'
import Api from '../../api'
/* link / navLinkto (to) prop använder invoice number för att ladda sidan med
  rätt id
*/

let initalValue = {
	loadScooters: false,
	content: []
}

let initalValueLoadCitys = {
	loadCity: false,
}

const Admin = () => {
	const [scooter, setScooter] = useState(initalValue);
	const [ifToShowCity, setIfToShowCity] = useState(initalValueLoadCitys);

	// hämtar ju alla scootrar här varje gång man trycker.
	// Kanske onödigt? Samtidigt vill man få det uppdaterat?
	const getScooters = async() => {
        try {
            let res = await Api.getAllScooters();  
			setScooter(prevState => ({
				loadScooters: !prevState.loadScooters,
				content: res
			  }));
        } catch (error) {
			console.log(error)
        }
    }

	const getCitys = async() => {
		try {
			setIfToShowCity(prevState => ({
				loadCity: !prevState.loadCity,
				}));
        } catch (error) {
			console.log(error)
        }
	}

return (
    <Wrapper>
        <Content>
			<Nav>
				<styledBtn onClick= {getScooters}> Visa cyklar </styledBtn>
				<styledBtn onClick= {getCitys}>  Visa städer </styledBtn>
			</Nav>
			<MapContainer>
				<Map scooter={scooter} ifToShowCity={ifToShowCity} ></Map>
			</MapContainer>
        </Content>
    </Wrapper>
  )
}

export default Admin
